INSERT INTO `announcements` VALUES (1,'Alumni WhatsApp Group','As LICET Alumni, we are growing gradually. All the LICET Alumni will be the part of Chennai chapter. All our Alumni are spread across different part of the world. To stay connected to everyone Alumni Association have created different chapter WhatsApp group. I request everyone to join the corresponding Alumni chapter group and stay connected. I request everyone to share the information and group links to known contacts of LICET Alumni. Department and Batch wise WhatsApp Group will be shared shortly.\r\n','2023-03-09','');
